create table people_similar
(
    id           bigint,
    person_name  varchar(255)
        constraint people_similar_work_crypto_people_name_fk
            references crypto_people (name),
    similar_name text
        constraint people_similar_name_work_crypto_people_name_fk
            references crypto_people (name)
);

alter table people_similar
    owner to application;

